import React from "react";
import componentStyle from "./index.module.css";

export default class MultiphysicsNumericalAlgorithms extends React.Component {
  constructor(props) {
    super(props);
    this.state.isUnfold = [
      false,
      false,
      false,
      false,
      false,
      false,
      false,
      false,
    ];
  }

  content = [
    "区域分解（DDM）",
    "预条件（RC）",
    "SG算法",
    "牛顿迭代算法",
    "控制体积有限元（CV-FEM）",
    "迎风格式有限元（SUPG-FEM）",
    "时域有限元（FETD）",
    "时域有限差分（FDTD）",
  ];

  render() {
    return (
      <div className={componentStyle.container}>
        <div className={componentStyle.title}>多物理场数值算法</div>
        <div className={componentStyle.select}>
          <div>
            <span>区域分解（DDM）</span>
          </div>
          <div>
            <span>预条件（RC）</span>
          </div>
          <div></div>
          <div></div>
          <div></div>
          <div></div>
          <div></div>
          <div></div>
        </div>
      </div>
    );
  }
}
